import { Container, Row, Col, Button, Card } from "react-bootstrap";
function BestSellers() {
  return (
    <div /* className="About" */ /* style={sty2} */>
      <br />

      <Container>
        <br />
        <br />
        {/* Stack the columns on mobile by making one full-width and the other half-width */}
        <center>
          <font style={{ fontSize: "22px" }}>Best Sellers</font>
        </center>
        <br />
        <br />
        <center>
          <Row style={{ justify: "center", width: "70%" }}>
            <Col
              xs={12}
              md={4}
              style={{
                height: "40vh",
              }}
            >
              <Card style={{ width: "100%", border: "0px" }}>
                <Card.Img variant="top" src="./assets/img/1.png" />
                <Card.Body>
                  <Card.Text style={{ marginLeft: "0px" }}>
                    <label style={{ marginLeft: "0px" }}>Some quick</label>
                  </Card.Text>
                </Card.Body>
              </Card>
            </Col>
            <Col
              xs={12}
              md={4}
              style={{
                height: "40vh",
              }}
            >
              <Card style={{ width: "100%", border: "0px" }}>
                <Card.Img variant="top" src="./assets/img/2.png" />
                <Card.Body>
                  <Card.Text>Some quick</Card.Text>
                </Card.Body>
              </Card>
            </Col>
            <Col
              xs={12}
              md={4}
              style={{
                height: "40vh",
              }}
            >
              <Card style={{ width: "100%", border: "0px" }}>
                <Card.Img variant="top" src="./assets/img/3.png" />
                <Card.Body>
                  <Card.Text>
                    Some quick example text to build on the card title and make
                    up the bulk of the card's content.
                  </Card.Text>
                </Card.Body>
              </Card>
            </Col>
          </Row>
        </center>
      </Container>
    </div>
  );
}
export default BestSellers;
